import React, { useState } from 'react';
import { useTranslation } from 'react-i18next';
import { motion } from 'framer-motion';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGlobe, faCode } from '@fortawesome/free-solid-svg-icons';
import { faGithub } from '@fortawesome/free-brands-svg-icons';
import './Projects.css';

const Projects = () => {
  const { t } = useTranslation();
  const [filter, setFilter] = useState('all');
  
  // Usamos URLs placeholders en lugar de importar imágenes
  const drupalPlaceholder = 'https://via.placeholder.com/600x400/334155/61DAFB?text=Drupal+Project';
  const wpPlaceholder = 'https://via.placeholder.com/600x400/334155/61DAFB?text=WordPress+Project';
  const angularPlaceholder = 'https://via.placeholder.com/600x400/334155/61DAFB?text=Angular+Project';
  
  // Datos de proyectos
  const projects = [
    {
      id: 1,
      title: 'Consum',
      category: 'drupal',
      image: drupalPlaceholder,
      description: 'Desarrollo de nueva página Web que permite información sobre artículos, tiendas, consultas de cupones, comprar productos.',
      technologies: ['Drupal 9', 'PHP', 'JavaScript', 'API REST'],
      liveUrl: 'https://www.consum.es',
      githubUrl: '',
      featured: true
    },
    {
      id: 2,
      title: 'Ayuntamiento de Benidorm',
      category: 'drupal',
      image: drupalPlaceholder,
      description: 'Multisite con noticias, información de política, áreas municipales, eventos destacados.',
      technologies: ['Drupal 8', 'PHP', 'JavaScript', 'SASS'],
      liveUrl: 'https://www.benidorm.org',
      githubUrl: '',
      featured: true
    },
    {
      id: 3,
      title: 'Hospitales HM',
      category: 'drupal',
      image: drupalPlaceholder,
      description: 'Sitio web con noticias de salud, coronavirus, investigación, premios, etc.',
      technologies: ['Drupal 7/8', 'PHP', 'JavaScript'],
      liveUrl: 'https://www.hmhospitales.com',
      githubUrl: '',
      featured: false
    },
    {
      id: 4,
      title: 'Edificaciones Caballero',
      category: 'wordpress',
      image: wpPlaceholder,
      description: 'Sitio para compra o venta y alquiler de edificios, con nuevos contenidos e imágenes.',
      technologies: ['WordPress', 'PHP', 'JavaScript', 'CSS'],
      liveUrl: '',
      githubUrl: '',
      featured: false
    },
    {
      id: 5,
      title: 'Gestión de Tareas',
      category: 'angular',
      image: angularPlaceholder,
      description: 'Aplicación de gestión de tareas con autenticación y persistencia de datos.',
      technologies: ['Angular', 'TypeScript', 'Bootstrap', 'Firebase'],
      liveUrl: '',
      githubUrl: 'https://github.com/DM13250/task-manager',
      featured: true
    },
    {
      id: 6,
      title: 'API REST con C#',
      category: 'csharp',
      image: angularPlaceholder,
      description: 'Desarrollo de API REST para sistema de gestión interna.',
      technologies: ['C#', '.NET Core', 'SQL Server', 'Swagger'],
      liveUrl: '',
      githubUrl: 'https://github.com/DM13250/dotnet-api',
      featured: false
    },
  ];
  
  // Filtrado de proyectos
  const filteredProjects = filter === 'all' 
    ? projects 
    : projects.filter(project => project.category === filter);
  
  // Animaciones
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };
  
  const projectVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        type: 'spring',
        stiffness: 100,
        damping: 12
      }
    }
  };

  return (
    <section id="proyectos" className="projects-section">
      <div className="container">
        <motion.div
          className="section-title"
          initial={{ opacity: 0, y: -20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true, amount: 0.2 }}
          transition={{ delay: 0.2 }}
        >
          <h2>{t('proyectos.titulo')}</h2>
          <div className="underline"></div>
          <p className="section-subtitle">{t('proyectos.descripcion')}</p>
        </motion.div>
        
        <div className="projects-filter">
          <button
            className={`filter-btn ${filter === 'all' ? 'active' : ''}`}
            onClick={() => setFilter('all')}
          >
            Todos
          </button>
          <button
            className={`filter-btn ${filter === 'drupal' ? 'active' : ''}`}
            onClick={() => setFilter('drupal')}
          >
            Drupal
          </button>
          <button
            className={`filter-btn ${filter === 'wordpress' ? 'active' : ''}`}
            onClick={() => setFilter('wordpress')}
          >
            WordPress
          </button>
          <button
            className={`filter-btn ${filter === 'angular' ? 'active' : ''}`}
            onClick={() => setFilter('angular')}
          >
            Angular
          </button>
          <button
            className={`filter-btn ${filter === 'csharp' ? 'active' : ''}`}
            onClick={() => setFilter('csharp')}
          >
            C#
          </button>
        </div>
        
        <motion.div 
          className="projects-grid"
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true, amount: 0.1 }}
        >
          {filteredProjects.map(project => (
            <motion.div 
              className="project-card" 
              key={project.id}
              variants={projectVariants}
            >
              <div className="project-image">
                <img src={project.image} alt={project.title} />
                {project.featured && <span className="featured-badge">Destacado</span>}
              </div>
              
              <div className="project-content">
                <h3>{project.title}</h3>
                <p>{project.description}</p>
                
                <div className="project-tech">
                  {project.technologies.map((tech, index) => (
                    <span key={index} className="tech-tag">{tech}</span>
                  ))}
                </div>
                
                <div className="project-links">
                  {project.liveUrl && (
                    <a href={project.liveUrl} target="_blank" rel="noopener noreferrer" className="project-link">
                      <FontAwesomeIcon icon={faGlobe} /> Sitio Web
                    </a>
                  )}
                  
                  {project.githubUrl && (
                    <a href={project.githubUrl} target="_blank" rel="noopener noreferrer" className="project-link">
                      <FontAwesomeIcon icon={faGithub} /> GitHub
                    </a>
                  )}
                </div>
              </div>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </section>
  );
};

export default Projects;
